import React from 'react';
import {connect} from "react-redux";
import {withRouter} from "react-router-dom"
import {compose} from "redux";
import WatchOreder from "./LaterSeenOrder";
import {buy} from "../../../../Redux/buy-item-reducer";


class LaterOrderContainer extends React.Component {


    render() {
        return (
            <div>
                <WatchOreder item={this.props.item[this.props.match.params.id]} buy={this.props.buy}/>
            </div>
        )
    }
}


let mapStateToprops = (state) => {

    return {
        item: state.laterSeenPage.item,


    }


}

export default compose(
    connect(mapStateToprops, {buy}),
    withRouter,
)(LaterOrderContainer)
